import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from 'react-router-dom';
import './App.css'; // CSS 파일을 가져옵니다.

const UploadPage = () => {
  const handleUpload = () => {
    alert('회원가입을 먼저 해주세요.');
  };

  return (
    <div className="upload-section">
      <h1>이미지 업로드 및 진단</h1>
      <input type="file" id="fileInput" className="custom-file-input" />
      <label htmlFor="fileInput" className="upload-button">이미지 선택하기</label>
      <p className="file-name">파일을 선택해주세요.</p>
      <button onClick={handleUpload}>진단</button>
      <div className="results-section">
        <h3>진단 결과:</h3>
        <p>진단 결과 없음</p>
        <h3>분류 결과:</h3>
        <pre>분류 결과 없음</pre>
      </div>
    </div>
  );
};

const SignUpPage = () => {
  const navigate = useNavigate();
  return (
    <div className="form-container sign-up-container">
      <form>
        <h1>Create Account</h1>
        <div className="social-container">
          <button className="social"><i className="fab fa-facebook-f"></i></button>
          <button className="social"><i className="fab fa-google-plus-g"></i></button>
          <button className="social"><i className="fab fa-linkedin-in"></i></button>
        </div>
        <span>or use your email for registration</span>
        <div className="infield">
          <input type="text" placeholder="Name" />
          <label></label>
        </div>
        <div className="infield">
          <input type="email" placeholder="Email" name="email"/>
          <label></label>
        </div>
        <div className="infield">
          <input type="password" placeholder="Password" />
          <label></label>
        </div>
        <button type="button" onClick={() => navigate('/signin')}>Sign Up</button>
      </form>
    </div>
  );
};

const SignInPage = () => {
  const navigate = useNavigate();
  return (
    <div className="form-container sign-in-container">
      <form>
        <h1>Sign in</h1>
        <div className="social-container">
          <button className="social"><i className="fab fa-facebook-f"></i></button>
          <button className="social"><i className="fab fa-google-plus-g"></i></button>
          <button className="social"><i className="fab fa-linkedin-in"></i></button>
        </div>
        <span>or use your account</span>
        <div className="infield">
          <input type="email" placeholder="Email" name="email"/>
          <label></label>
        </div>
        <div className="infield">
          <input type="password" placeholder="Password" />
          <label></label>
        </div>
        <button type="button" className="forgot">Forgot your password?</button>
        <button type="button" onClick={() => navigate('/upload')}>Sign In</button>
      </form>
    </div>
  );
};

function App() {
  return (
    <Router>
      <div className="container">
        <div className="header">
          <Link to="/" className="daemonset-logo">DaemonSet</Link>
          <div className="nav-links">
            <Link to="/signin">로그인</Link>
            <Link to="/">회원가입</Link>
          </div>
        </div>
        <Routes>
          <Route path="/" element={<SignUpPage />} />
          <Route path="/signin" element={<SignInPage />} />
          <Route path="/upload" element={<UploadPage />} />
        </Routes>
        <button className="diagnosis-button" onClick={() => window.location.href='/upload'}>진단하기</button>
      </div>
    </Router>
  );
}

export default App;
